package backend.demo.model;import org.hibernate.annotations.CreationTimestamp;import javax.persistence.*;import java.util.Date;@Entity@Table(name = "Countries")public class Product {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private long id;    @Column(name = "country_name")    private String country_name;    @CreationTimestamp    private Date createdAt;    @CreationTimestamp    private Date updatedAt;    public void setId(long id) {        this.id = id;    }    public long getId() {        return id;    }    public void setCountry_name(String country_name) {        this.country_name = country_name;    }    public String getCountry_name() {        return country_name;    }    public void setCreatedAt(Date createdAt) {        this.createdAt = createdAt;    }    public Date getCreatedAt() {        return createdAt;    }    public void setUpdatedAt(Date updatedAt) {        this.updatedAt = updatedAt;    }    public Date getUpdatedAt() {        return updatedAt;    }}